  \"2016-07-27T23:06:08.976943\",\n\t\"name\": \"lewis-and-clark-nwr-initial-survey-instructions-for-marbled-murrelet-monitoring-nest-site-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The marbled murrelet (Brachyramphus marmoratus)
  is a year-round resident on Washington marine coastal waters and nests in mature
  and old-growth forests within 39 miles (63 kilometers) of shore. The marbled murrelet
  is federally listed as threatened in California, Oregon and Washington, and is state
  listed as threatened by the state of Washington. Loss of high- quality nesting habitat
  and increased forest fragmentation are the main causes cited for the declining marbled
  murrelet population (Raphael et al. 2008; USFWS 1997).The Marbled Murrelet recovery
  plan (USFWS 1997) identifies southwest Washington as a significant gap in suitable
  nesting habitat along the Pacific Northwest coast. Maintaining and increasing suitable
  habitat in this region is critical to overall species recovery. Nest site monitoring
  can help track changes in nesting distribution over time as recovery progresses.
  The Refuge staff is also obligated to monitor changes in marbled murrelet use of
  suitable sites within lands acquired through damage assessment mitigation funds
  and at sites where habitat restoration was untaken. Finally, the presence of federally
  listed species on Refuge lands should be monitored to assist in management planning
  and to address section 7 and special use permit requirements.\",\n\t\"license_title\":
